    function an(n) {
        return anArr.slice(0,n)
    }
    function gn(n) {
        var anArr = an(n)
        return anArr.map((e, i, arr) => {
            if (i == 0) return 1
            return arr[i] - arr[i - 1]
        })
    }
    function countOnes(n) {
        return gn(n).filter(e => e == 1).length
    }
    function Pn(n) {
        let index = 0
        let primeArr = []
        while (primeArr.length < n) {
            let temp = anArr[index+1] - anArr[index]
            if (temp != 1 && primeArr.indexOf(temp) == -1) primeArr.push(temp)
            index++
        }
        return primeArr;
    };
    function maxPn(n) {
        return Pn(n).sort((a, b) => b - a)[0]
    };
    function anOver(n) {
        return an(n).reduce((p, c, i) => {
            if (c != 1) p.push(c / (i + 1))
            return p
        }, [])
    }
